import React, { Component } from 'react';
import logo from './../img/logo.svg';
import Nav from './Nav';
import GameList from './GameList';
import Footer from './Footer';
import GameRoom from './GameRoom'

const games = {
  tictactoe : {
    name : "Tic Tac Toe",
    board : "[0,0,0,0,0,0,0,0,0]",
    capacity : 2,
  }
}

class GameRoomListPage extends Component {
  constructor(){
    super()
    this.state = {}
    setInterval(() => {
      this.fetchGameRooms()
    }, 1000);
  }

  fetchGameRooms(){
    console.log("1")
  }

  render() {
    return (
      <div className="App" id="page-top">
        <div className="wrapper">
        <Nav />
          <section className="portfolio" id="portfolio">
            <div className="container">
              <h2 className="text-center text-uppercase text-secondary mb-0">{games[this.props.match.params.name]["name"]}</h2>
                <hr className="star-dark mb-5" />
                <div className="row">
                <GameRoom id="1" users={[{name: "Abc"},{name: "Bbb"}]}/>
                <GameRoom id="2" users={[{name: "Ccc"},{name: "Ddd"}]}/>
                <GameRoom id="3" users={[{name: "Eee"},{name: "Ggg"}]}/>
                </div>
              </div>
          </section>
        </div>
        <div className="pusher">
        </div>
        <Footer />
      </div>
    );
  }
}

export default GameRoomListPage;
